import { Data, Params } from 'src/request/entity.d';
import { post, get, upload } from "src/request/api"

// 取消任务上传图
export const cancelTaskUpload = (data: any,params:any) => {
 return upload('/api/v1/app/timing/cancel-timing-task/upload-img', data,params)
}
// 查询我的限时任务详情
export const myTaskDetail = (data: Data) => {
 return get('/api/v1/app/timing/my-task-detail', data)
}
